import React from 'react';
import { Routes } from 'react-router-dom';
import './App.css';
import ILcars from './components/ILcars';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <header>
          <NavBar />

        </header>
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/TopSeries' element={<TopSeries />} />
          <Route path='/about' element={<About />} />
        </Routes>
      </BrowserRouter>
      <ILcars />
    </div>
  );
}

export default App;
